package dotalike.common.model.external;

public class Signature {
	
	private String hero;
	
	private int matchesWithHero;
	
	private int allMatches;

	public String getHero() {
		return hero;
	}

	public void setHero(String hero) {
		this.hero = hero;
	}

	public int getMatchesWithHero() {
		return matchesWithHero;
	}

	public void setMatchesWithHero(int matchesWithHero) {
		this.matchesWithHero = matchesWithHero;
	}

	public int getAllMatches() {
		return allMatches;
	}

	public void setAllMatches(int allMatches) {
		this.allMatches = allMatches;
	}
	
}
